CREATE   PROCEDURE [dbo].[Report_Payment_Sheet]
@IdReportTask [numeric](16, 0)
AS
BEGIN
SELECT TMPDetailedCalendarEmployeePagosLear.DatePlanification, TMPDetailedCalendarEmployeePagosLear.PuncheIn1, TMPDetailedCalendarEmployeePagosLear.ValueConcept1, TMPDetailedCalendarEmployeePagosLear.ValueConcept3, TMPDetailedCalendarEmployeePagosLear.ValueConcept5, TMPDetailedCalendarEmployeePagosLear.ValueConcept6, TMPDetailedCalendarEmployeePagosLear.ValueConcept7, TMPDetailedCalendarEmployeePagosLear.ValueConcept8, TMPDetailedCalendarEmployeePagosLear.ValueConcept4, TMPDetailedCalendarEmployeePagosLear.EmployeeName, TMPDetailedCalendarEmployeePagosLear.ValueConcept2, TMPDetailedCalendarEmployeePagosLear.ConceptName6, TMPDetailedCalendarEmployeePagosLear.ConceptName7, TMPDetailedCalendarEmployeePagosLear.ConceptName8, TMPDetailedCalendarEmployeePagosLear.Rendimiento, TMPDetailedCalendarEmployeePagosLear.Estimulo, EmployeeContracts.IDContract, TMPDetailedCalendarEmployeePagosLear.IDEmployee, TMPDetailedCalendarEmployeePagosLear.IDReportTask, TMPDetailedCalendarEmployeePagosLear.HorasCien, TMPDetailedCalendarEmployeePagosLear.Paro, TMPDetailedCalendarEmployeePagosLear.Otros,
(select dbo.GetEmployeeUserFieldValueMin(TMPDetailedCalendarEmployeePagosLear.IDEmployee,'Empresa',TMPDetailedCalendarEmployeePagosLear.DatePlanification)) As Company,
(select dbo.GetEmployeeUserFieldValueMin(TMPDetailedCalendarEmployeePagosLear.IDEmployee,'Centro',TMPDetailedCalendarEmployeePagosLear.DatePlanification)) As Center,
(select dbo.GetEmployeeUserFieldValueMin(TMPDetailedCalendarEmployeePagosLear.IDEmployee,'Seccion',TMPDetailedCalendarEmployeePagosLear.DatePlanification)) As Section,
(select dbo.GetEmployeeUserFieldValueMin(TMPDetailedCalendarEmployeePagosLear.IDEmployee,'N.EMPLEADO',TMPDetailedCalendarEmployeePagosLear.DatePlanification)) As EmployeeNumber
 FROM   TMPDetailedCalendarEmployeePagosLear TMPDetailedCalendarEmployeePagosLear INNER JOIN EmployeeContracts EmployeeContracts ON ((TMPDetailedCalendarEmployeePagosLear.IDEmployee=EmployeeContracts.IDEmployee) AND (TMPDetailedCalendarEmployeePagosLear.DatePlanification>=EmployeeContracts.BeginDate)) AND (TMPDetailedCalendarEmployeePagosLear.DatePlanification<=EmployeeContracts.EndDate)
 WHERE  TMPDetailedCalendarEmployeePagosLear.IDReportTask=@IdReportTask 
 ORDER BY TMPDetailedCalendarEmployeePagosLear.EmployeeName, EmployeeContracts.IDContract, TMPDetailedCalendarEmployeePagosLear.DatePlanification, TMPDetailedCalendarEmployeePagosLear.PuncheIn1
END
GO

